import React from 'react';

const Calendar = () => {
  const weeks = [
    // Semaine 1
    [
      { date: 30, events: [] },
      { date: 31, events: [] },
      { date: 'November 1', events: [] },
      { date: 2, events: [] },
      { date: 3, events: [] },
      { date: 4, events: [] },
    ],
    // Semaine 2
    [
      { date: 6, events: [] },
      { date: 7, events: ['Event 1', 'Event 2', 'Event 3'] },
      { date: 8, events: ['Delete', 'Blue', 'Green'] },
      { date: 9, events: [] },
      { date: 10, events: [] },
      { date: 11, events: [] },
    ],
    // Semaine 3
    [
      { date: 13, events: [] },
      { date: 14, events: ['Event 4', 'Event 5'] },
      { date: 'Yellow', events: ['Red', 'Auto'] },
      { date: 16, events: [] },
      { date: 17, events: [] },
      { date: 18, events: [] },
    ],
    // Semaine 4
    [
      { date: 20, events: [] },
      { date: 21, events: [] },
      { date: 22, events: [] },
      { date: 23, events: [] },
      { date: 24, events: [] },
      { date: 25, events: [] },
    ]
  ];

  return (
    <div className="calendar">
      <style>{`
        .calendar {
          font-family: Arial, sans-serif;
          margin: 20px;
          max-width: 1000px;
        }
        
        table {
          border-collapse: collapse;
          width: 100%;
          border: 1px solid #ddd;
        }
        
        th, td {
          border: 1px solid #ddd;
          padding: 12px;
          vertical-align: top;
          width: 16.66%;
        }
        
        th {
          background-color: #f8f9fa;
          font-weight: bold;
          text-align: center;
        }
        
        .date {
          font-weight: bold;
          margin-bottom: 8px;
          color: #2c3e50;
        }
        
        .event {
          font-size: 0.85em;
          padding: 4px;
          margin: 2px 0;
          background: #f0f4f8;
          border-radius: 3px;
        }
        
        .special-date {
          color: #e74c3c;
        }
      `}</style>

      <table>
        <thead>
          <tr>
            {['Sunday', 'Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday'].map((day) => (
              <th key={day}>{day}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          {weeks.map((week, weekIndex) => (
            <tr key={weekIndex}>
              {week.map((day, dayIndex) => (
                <td key={dayIndex}>
                  <div className={`date ${dayIndex === 2 ? 'special-date' : ''}`}>
                    {day.date}
                  </div>
                  {day.events.map((event, eventIndex) => (
                    <div key={eventIndex} className="event">
                      {event}
                    </div>
                  ))}
                </td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Calendar;
